(window.webpackJsonp=window.webpackJsonp||[]).push([[1483],{1838:function(n,h,t){"use strict";t.r(h);var g=t(44),i=Object(g.a)({},(function(){var n=this,h=n.$createElement,t=n._self._c||h;return t("ContentSlotsDistributor",{attrs:{"slot-key":n.$parent.slotKey}},[t("h1",{attrs:{id:"chuong-257-khong-phai-lang-bam-la-cai-gi"}},[t("a",{staticClass:"header-anchor",attrs:{href:"#chuong-257-khong-phai-lang-bam-la-cai-gi"}},[n._v("#")]),n._v(" Chương 257: Không phải lang băm là cái gì?")]),n._v(" "),t("hr"),n._v(" "),t("p",[t("br"),t("br"),n._v("“Nói Thanh Dương Tông sư là lang băm?”"),t("br"),t("br"),n._v("“Nói hắn là y thuật thấp kém ngu xuẩn?”"),t("br"),t("br"),n._v("Tất cả mọi người ngây người."),t("br"),t("br"),n._v("Vẫn đối với Trương Huyền có ý kiến Mạc Vũ tiểu thư, cũng kinh ngạc tại chỗ."),t("br"),t("br"),n._v("Nói thẳng một vị y đạo Tông sư là lang băm... Bực này tại nhục mạ đối phương nghề nghiệp xưa nay, triệt để không nể mặt mũi."),t("br"),t("br"),n._v("Ngươi một cái đối với y đạo cái gì cũng không hiểu gia hỏa, trang cái gì củ hành?"),t("br"),t("br"),n._v("Thiến đi man thú, tuy rằng không thường thấy, nhưng cũng không phải là không có qua, hiện tại thiết răng Khiếu Thiên hổ dáng vẻ ấy, không làm như vậy chẳng lẽ còn có những biện pháp khác?"),t("br"),t("br"),n._v("“Trương thú sư...”"),t("br"),t("br"),n._v("Không nghĩ tới lúc này hắn biết nói chuyện, hơn nữa trực tiếp mở mắng, Phong đường chủ cũng biến sắc mặt, vội vã xua tay: “Thanh Dương Tông sư, ngươi đừng nóng giận, hắn không phải cố ý...”"),t("br"),t("br"),n._v("“Ngươi ngậm miệng!”"),t("br"),t("br"),n._v("Thanh Dương Tông sư sắc mặt dữ tợn, như là một cái nổi giận cuồng sư, lạnh lùng nhìn về phía thanh niên trước mắt, ngữ khí băng hàn: “Ta Thanh Dương làm nghề y ba mươi chín năm qua, vang danh vương quốc, y vô số người, cứu sống không biết bao nhiêu người, vẫn là lần thứ nhất bị người như vậy nhục mạ. Tiểu tử, ta không quản ngươi có đúng hay không chính thức thuần thú sư, sau lưng có có thân phận gì, ngày hôm nay không đem lời nói rõ ràng ra, đừng trách ta trở mặt không khách khí!”"),t("br"),t("br"),n._v("Ầm ầm!"),t("br"),t("br"),n._v("Âm thanh kết thúc, trên người một luồng khí tức xông thẳng lên trời, áp bức Vân Đào mấy người liên tiếp lui về phía sau."),t("br"),t("br"),n._v("Dĩ nhiên cũng là cho rằng Tông sư cảnh cường giả!"),t("br"),t("br"),n._v("Bất luận loại nghề nghiệp nào, không những cần đặc thù thiên phú, còn cần thực lực cùng với xứng đôi, đạt đến nhị tinh, cơ bản đều sẽ là Tông sư cường giả, chính vì như thế, nhất tinh nghề nghiệp được gọi là Đại sư, nhị tinh được gọi là Tông sư, không những là đúng nghề nghiệp tôn sùng, càng quan trọng là đúng tu vi kính sợ."),t("br"),t("br"),n._v("Thanh Dương thân là toàn bộ Bắc Vũ vương quốc lợi hại nhất y sư, một đời làm nghề y, đâu bị như vậy nhục mạ, nếu không là hàm dưỡng cao, khẳng định đã sớm nổ."),t("br"),t("br"),t("br"),n._v("“Không bị như vậy mắng... Đó là bởi vì không gặp phải ta, sớm gặp phải, đã sớm mắng!”"),t("br"),t("br"),n._v("Đối mặt với đối phương uy thế, Trương Huyền vẻ mặt hờ hững nhìn sang."),t("br"),t("br"),n._v("Thanh Dương Tông sư hai hàng lông mày run rẩy: “Ngươi cho rằng ta không dám giết ngươi?”"),t("br"),t("br"),n._v("“Giết ta? Không nhìn ra chứng bệnh, liền ngông cuồng xuống chẩn đoán bệnh, thật muốn theo lời ngươi nói, không những cứu không được con này Khiếu Thiên thú, còn có thể làm hại nó tại chỗ tử vong... Này chính là của ngươi trị liệu kết quả? Không phải lang băm là cái gì? Còn giết ta... Sai rồi không cho người nói, da mặt sao như thế dày đâu?” Trương Huyền mí mắt nhấc lên."),t("br"),t("br"),n._v("“Ngươi...”"),t("br"),t("br"),n._v("Không nghe lời này cũng còn tốt, vừa nghe xong, Thanh Dương Tông sư tức đến gần thổ huyết."),t("br"),t("br"),n._v("Hắn Tông sư cảnh uy thế toàn lực thả ra ngoài, vốn tưởng rằng đối phương sẽ run rẩy xin lỗi, nằm mơ đều không nghĩ tới không chỉ nói lẽ thẳng khí hùng, còn mắng hắn da mặt dày..."),t("br"),t("br"),n._v("Đường đường y đạo Tông sư, bị người trước mặt mọi người nhục mạ, đều sắp trực tiếp điên rồi."),t("br"),t("br"),n._v("“Có phải là cảm thấy không phục? Vậy ta liền nói cho ngươi nói!”"),t("br"),t("br"),n._v("Lửa giận thiêu đốt, đang muốn tức giận, liền thấy thanh niên trước mắt, hai bước đi tới Khiếu Thiên thú trước mặt."),t("br"),t("br"),n._v("“Thiết Xỉ Khiếu Thiên Thú muốn xem tuổi, trực tiếp nhất căn cứ là hàm răng. Thành niên Khiếu Thiên thú, hàm răng lộ ra ở bên ngoài tổng cộng ba thước ba tấc, không dài không ngắn, điểm ấy chắc hẳn chỉ cần là thuần thú sư đều biết, không cần ta nhiều lời!”"),t("br"),t("br"),n._v("Trương Huyền chỉ tay trước mắt Khiếu Thiên thú: “Cái tên này hàm răng, chỉ có hai thước 7 tấc, nói cách khác, khoảng cách thành niên còn cách một đoạn. Nếu như ta không nhìn lầm, nó chắc là mới mười bảy tuổi, dựa theo Khiếu Thiên thú hai trăm năm tuổi thọ, chỉ có thể coi là tuổi ấu thơ... Ta muốn hỏi một chút, tuổi ấu thơ man thú, tại sao có thể có giao phối dục vọng?”"),t("br"),t("br"),n._v("Vốn là Phong đường chủ mấy người cũng cảm thấy vị này Trương Huyền là tại hồ đồ, nghe nói như thế tất cả đều sững sờ."),t("br"),t("br"),n._v("Con này Khiếu Thiên thú, người khác không biết bao lớn, mấy người bọn hắn thế nhưng rất rõ ràng, từ nhỏ đã nuôi ở đây, vừa vặn mười bảy năm, nói không hề có một chút sai lầm."),t("br"),t("br"),n._v("Nếu như không phải sớm biết, chỉ nhìn cái tên này như vậy khổng lồ hình thể, tuyệt không thể tin được, chỉ có mười bảy tuổi."),t("br"),t("br"),n._v("Đối lập tại hai trăm năm tuổi thọ man thú, ở độ tuổi này, cùng nhân loại bảy, tám tuổi gần như."),t("br"),t("br"),n._v("“Nó là man thú...” Thanh Dương Tông sư hừ nói, nói còn chưa dứt lời, liền bị cắt đứt."),t("br"),t("br"),n._v("“Không muốn nói với ta, man thú thân thể cùng nhân loại không giống, trưởng thành cũng không giống nhau, nếu như cái tên này thực sự là động dục, muốn tìm kiếm phối ngẫu, cũng nhiều nhất khô nóng khó nhịn, tính tình táo bạo, phát cái tình sẽ hôn mê, ngủ say không nổi... Thanh Dương Tông sư như vậy phán định, lẽ nào ngươi cảm thấy... Ngươi giống như nó?”"),t("br"),t("br"),n._v("Trương Huyền nói tiếp."),t("br"),t("br"),n._v("“Đúng vậy!”"),t("br"),t("br"),n._v("“Động dục nhiều nhất khó chịu, còn không nghe nói ai muốn nữ nhân muốn tới bản thân hôn mê!”"),t("br"),t("br"),n._v("Mọi người đầu tiên là sững sờ, lập tức nói thầm lên."),t("br"),t("br"),n._v("Thành niên muốn tìm phối ngẫu, đây là sinh lý nhu cầu, không tính là gì, không những man thú sẽ có, người cũng sẽ xuất hiện tình huống như thế, nhưng chưa từng nghe nói, ai bởi vì không tìm được bạn gái, đem mình mạnh mẽ bực bội ngất."),t("br"),t("br"),n._v("Này mẹ nó hoàn toàn không phù hợp lẽ thường a!"),t("br"),t("br"),n._v("“Hừ!”"),t("br"),t("br"),n._v("Thanh Dương Tông sư sắc mặt bực bội thấu hồng, muốn giải thích, cũng không biết làm sao trả lời, quăng một cái ống tay áo hừ một tiếng: “Ngươi nói không phải động dục, cái kia vì sao nôn nóng bất an? Đặc biệt là đêm trăng tròn, qua lại chạy trốn, có phát tiết không xong tinh lực?”"),t("br"),t("br"),n._v("“Nôn nóng bất an, có phát tiết không xong tinh lực, chính là muốn tìm bạn đời? Đây là cái gì lý luận?” Trương Huyền lắc đầu: “Nếu như chỉ là nguyên nhân này, vì sao không muốn ăn cơm, cái gì đều dẫn không nổi hứng thú?”"),t("br"),t("br"),n._v("Thanh Dương Tông sư khàn giọng dừng."),t("br"),t("br"),n._v("Nếu như đúng là muốn tìm bạn đời, coi như man thú sẽ không nói, cũng sẽ có đủ loại biểu thị, không ăn cơm, đối với bất cứ chuyện gì đều không có hứng thú, xác thực để người khó hiểu."),t("br"),t("br"),n._v("“Căn cứ vừa mới cái kia học đồ ngôn ngữ, chúng ta có thể biết, cái tên này mười ngày phía trước, chỉ là không muốn ăn đồ vật, mấy ngày nay từ từ tăng thêm, thậm chí đến sáng sớm hôm nay, lại cũng không chịu nổi mà hôn mê. Nếu như đúng là muốn chọn ngẫu mà nói, trực tiếp bay đi liền có thể, có vẻ như Thú đường cũng không dùng xích sắt buộc lại nó, cấm chỉ nó phi hành đi!”"),t("br"),t("br"),n._v("Mọi người đồng thời gật đầu."),t("br"),t("br"),n._v("Thú đường nịnh bợ cũng không kịp, làm sao có khả năng buộc lại cái tên này?"),t("br"),t("br"),n._v("Thật muốn chọn ngẫu, thật khó chịu hơn, có thể bản thân bay đi đi ra ngoài tìm a, không đến mức vẫn ở trong sân đợi mạnh mẽ đem mình bực bội ngất đi!"),t("br"),t("br"),n._v("Nghe đến mấy cái này phân tích, tất cả mọi người đều đối với đó phía trước Thanh Dương Tông sư chẩn đoán bệnh có nghi hoặc, từng cái từng cái tràn đầy quái lạ nhìn sang."),t("br"),t("br"),n._v("“Cái kia... Ngươi nói là xảy ra chuyện gì?”"),t("br"),t("br"),n._v("Thanh Dương Tông sư sắc mặt trắng nhợt, cũng phát giác xem nhẹ không ít đồ vật, không còn vừa nãy tức giận, không nhịn được hỏi."),t("br"),t("br"),n._v("“Không phải tìm bạn đời, còn lại liền đơn giản... Vậy thì là, Khiếu Thiên thú thật sự thân mắc trọng bệnh hoặc là có những nguyên nhân khác!” Trương Huyền nhìn quanh một vòng: “Mọi người có thể nhìn Khiếu Thiên thú móng trảo.”"),t("br"),t("br"),n._v("“Khiếu Thiên thú cùng ưng loại man thú không giống, có dày đặc bắp thịt bao vây, cùng nhân loại bàn chân tương tự, cái này móng vuốt, dựa theo tình huống bình thường, hẳn là Kim Thanh sắc, mà trước mắt con này, màu da bên trong tiết lộ màu đỏ hoa văn.”"),t("br"),t("br"),n._v("Mọi người đồng loạt hướng Khiếu Thiên thú móng trảo nhìn sang, nhìn chút bên dưới, quả nhiên phát giác một chút đỏ như màu máu hoa văn."),t("br"),t("br"),n._v("Những cái này hoa văn cực kỳ bé nhỏ, cùng mao mạch mạch máu tương tự, không nhìn kỹ, khó có thể phát hiện."),t("br"),t("br"),n._v("“Giống như man thú đều có mào gà, con này Khiếu Thiên thú cũng không ngoại lệ, ở tình huống bình thường mào gà, có chứa đỏ như màu máu, mà giờ khắc này lại hơi trở nên trắng, tuy rằng nhỏ bé, nhưng cũng có thể nhìn thấy.” Trương Huyền tiếp tục nói."),t("br"),t("br"),n._v("Mọi người lại lần nữa nhìn lại, quả nhiên như hắn nói tới."),t("br"),t("br"),n._v("“Đây rốt cuộc là bệnh gì chứng?”"),t("br"),t("br"),n._v("Thấy hắn nói ra nhiều như vậy nhỏ bé biến hóa, mọi người lại lần nữa tin tưởng mấy phần, Phong đường chủ không nhịn được hỏi."),t("br"),t("br"),n._v("“Nói bệnh không phải bệnh, cẩn thận nói đến, ta còn muốn chúc mừng Phong đường chủ.”"),t("br"),t("br"),n._v("Trương Huyền cười cợt."),t("br"),t("br"),n._v("“Chúc mừng? Chúc mừng ta làm cái gì?”"),t("br"),n._v("Phong đường chủ một mặt choáng váng."),t("br"),t("br"),n._v("Khiếu Thiên thú hôn mê bất tỉnh, cũng không biết có không có nguy hiểm tính mạng, lại nói, coi như đã biết chứng bệnh, biết làm sao cứu trị, cũng muốn cứu tỉnh lại nói, lúc này chúc mừng làm cái gì?"),t("br"),t("br"),n._v("“Nếu như ta không nhìn lầm, Khiếu Thiên thú chắc là huyết mạch tiến dời!” Trương Huyền nói."),t("br"),t("br"),n._v("“Huyết mạch tiến dời? Chuyện này... Sao có thể có chuyện đó?”"),t("br"),t("br"),n._v("Phong đường chủ sửng sốt, những người khác cũng không thể tin được."),t("br"),t("br"),n._v("Man thú huyết mạch tiến dời, cùng biến dị tương tự, rất khó gặp được, không có căn bản nhất nguyên nhân dẫn đến, là không thể phát sinh."),t("br"),t("br"),n._v("Cái gọi là nguyên nhân dẫn đến, chính là hấp thu càng tinh khiết dòng máu, hoặc là dùng một số thiên tài địa bảo..."),t("br"),t("br"),n._v("Những cái này có vẻ như đều chưa từng có!"),t("br"),t("br"),n._v("Hơn nữa, coi như huyết mạch tiến dời, cũng không đến mức hôn mê, cùng bệnh nặng như thế đi."),t("br"),t("br"),n._v("Thấy mọi người không tin, Trương Huyền nhẹ nhàng nở nụ cười nhìn về phía Phong đường chủ: “Nửa tháng phía trước, con này Thiết Xỉ Khiếu Thiên Thú, có hay không đi qua âm khí nồng nặc chi địa?”"),t("br"),t("br"),n._v("“Chuyện này... Nửa tháng phía trước, nó từng chuyên môn đưa người đi tới Âm Phong cốc!” Trả lời chính là Vương thú sư."),t("br"),t("br"),n._v("Chính là hắn điều động đưa tới, nhớ tới rất rõ ràng."),t("br"),t("br"),n._v("“Âm Phong cốc âm khí nồng nặc, sản xuất nhiều một loại lợi hại thuộc tính Âm trái cây, Âm Phong quả, giúp đỡ giúp thuộc tính Âm thể chất người, tu vi tăng nhiều. Chắc hẳn người kia chính là coi đây là thù lao đi!” Trương Huyền nói."),t("br"),t("br"),n._v("“Vâng!” Vương thú sư gật đầu."),t("br"),t("br"),n._v("Lên tàu Thú đường Thú Thừa, có thể trả tiền, cũng có thể cho một ít hi hữu thiên tài địa bảo."),t("br"),t("br"),n._v("Âm Phong quả tiếng tăm rất lớn, đơn độc bán ra mà nói, có giá trị không nhỏ, hơn nữa có tiền cũng không thể mua được, đối phương coi đây là thù lao, Vương thú sư đương nhiên đáp ứng."),t("br"),t("br"),n._v("“Nguyên nhân liền xuất hiện tại đây viên Âm Phong quả bên trên!”"),t("br"),t("br"),n._v("Trương Huyền cười cợt: “Con này Khiếu Thiên thú giới tính, chắc hẳn mọi người đều biết, nam tính. Trong cơ thể dương hỏa trác thịnh, dùng Âm Phong quả, Âm Dương xung đột lẫn nhau, dựa theo đạo lý, nhiều nhất không quá thoải mái, lấy nó khổng lồ như thế hình thể, rất nhanh sẽ có thể chống đỡ đi qua! Kết quả, các ngươi một mực cho nó dùng Thanh Thần thủy.”"),t("br"),t("br"),n._v("“Thanh Thần thủy, tĩnh tâm thanh thần, có thể tiêu trừ táo bạo, trong đó chủ yếu nhất thành phần là .”"),t("br"),t("br"),n._v("“Đây là ổn định trung hoà tính thuốc, theo lý thuyết dùng nhiều hơn nữa đều không có chuyện gì, bất quá, không khéo chính là, vật này vừa vặn cùng Âm Phong quả thuộc tính xung đột lẫn nhau, một khi tiếp xúc, sẽ lập tức gợi ra sức mạnh, để thuộc tính Âm khí tức triệt để bạo phát, kích thích ra gấp ba trở lên hiệu quả, hai người kết hợp, chính là luyện chế  chủ yếu vật liệu, đối với dương thuộc tính thể chất sinh mệnh có rất lớn kích hoạt tác dụng.”"),t("br"),t("br"),n._v("Trương Huyền tiếp tục nói: “Khiếu Thiên thú trong cơ thể dương thuộc tính bị kích hoạt, lúc này mới ban đêm không ngủ, nắm giữ phát tiết không xong tinh lực, giống như tử xuân!”"),t("br"),t("br"),n._v("“Nếu như chỉ là như vậy, nó vẫn như cũ có thể kiên trì vượt qua, chỉ cần trong cơ thể Âm Dương cân bằng, tương tự có thể giải trừ mầm họa, đáng tiếc... Phong đường chủ lại khiến người ta cho ăn hai viên .”"),t("br"),t("br"),n._v("Nói đến đây Trương Huyền tràn đầy thương hại lắc lắc đầu: “Khứ Nhiệt đan bên trong ẩn chứa cực hàn thảo, vật này có thể tiêu trừ trong cơ thể dương hỏa... Khiếu Thiên thú vừa mới kích hoạt trong cơ thể dương thuộc tính sức mạnh, liền nắm vật này cho nó ăn, còn ăn một lần hai viên, tương đương với trực tiếp tại ngọn lửa bên trên vứt bỏ khối băng... Một nóng một lạnh bên dưới, không tại chỗ tử vong, coi như mạng lớn!”"),t("br"),t("br"),n._v("Nói thật, con này Khiếu Thiên thú vẫn đúng là đủ thương xót, vốn là không có chuyện gì, suýt chút nữa mạnh mẽ bị bọn họ cho cho ăn chết."),t("br"),t("br"),n._v("Còn cứu trị... Quả thực chính là giết người!"),t("br"),t("br"),n._v("Phong đường chủ, Lư thú sư đám người sắc mặt khó coi."),t("br"),t("br"),n._v("Rất hiển nhiên, bọn họ cũng không nghĩ tới, Khiếu Thiên thú sở dĩ dáng vẻ ấy, dĩ nhiên là bởi vì bọn họ... Cho ăn sai rồi dược!"),t("br"),t("br"),n._v("“Các ngươi cẩn thận nhớ lại một hồi, có phải là bởi vì đút dược sau đó, con này Khiếu Thiên thú bệnh tình mới từ từ chuyển biến xấu?” Trương Huyền hỏi tiếp."),t("br"),t("br"),n._v("“Phải...” Bẩm báo suy nghĩ một chút vừa nãy vị kia học đồ nói mà nói, mọi người không nhịn được gật đầu."),t("br"),t("br"),n._v("Xác thực như vậy."),t("br"),t("br"),n._v("Ai cũng không nghĩ tới, bình thường cho ăn ra thuốc, dĩ nhiên thành nổi lên tác dụng ngược lại."),t("br"),t("br"),n._v("“Trong cơ thể dương thuộc tính kích hoạt, cùng hàn thuộc tính đụng nhau, lúc này, nếu như đưa nó thiến đi, dương hỏa biến mất, âm khí lên cao, dùng không được một canh giờ, nó sẽ cắt đứt hô hấp, tại chỗ tử vong!”"),t("br"),t("br"),n._v("Nói đến đây, Trương Huyền nhìn về phía cách đó không xa Thanh Dương Tông sư: “Đây là ta vì sao phải nói ngươi là lang băm nguyên nhân. Thật muốn theo lời ngươi nói làm, không những cứu không được Khiếu Thiên thú, e sợ hiện tại đã là một bộ thi thể.”"),t("br"),t("br"),n._v("“Chuyện này...”"),t("br"),t("br"),n._v("Thanh Dương Tông sư lạnh cả người, làm nhị tinh y sư, đối với y đạo có cực kỳ cao thâm hiểu rõ, đối phương nói nhịp nhàng ăn khớp, vòng vòng tiến dần lên, phân tích càng là đâu ra đó, không có bất luận cái gì sai lầm, giống như tận mắt nhìn thấy giống như vậy, liền ngay cả hắn đều khâm phục không thôi, muốn phản bác, đều tìm không ra lý do."),t("br"),t("br"),n._v("“Ngươi mới vừa nói huyết mạch tiến dời, là xảy ra chuyện gì?”"),t("br"),t("br"),n._v("Sợ Thanh Dương Tông sư không chịu nổi, Phong đường chủ vội vàng nói sang chuyện khác."),t("br"),t("br"),n._v("“Trong cơ thể dương thuộc tính bị kích hoạt, ổn định lại, đương nhiên huyết mạch tiến dời, ngược lại, thì sẽ tử vong. Nói cách khác, hiện tại Khiếu Thiên thú, có thể vượt qua đi, tu vi sẽ có tiến bộ, được chỗ tốt cực lớn; Không kháng nổi đi, liền sẽ tử vong.”"),t("br"),t("br"),n._v("“Cái kia... Có thể có cứu trị phương pháp?” Phong đường chủ tràn đầy khẩn trương."),t("br"),t("br"),n._v("“Đương nhiên là có, bất quá... Khả năng cần một vị luyện đan sư phối hợp.” Trương Huyền chần chờ một chút nói."),t("br"),t("br"),n._v("“Mạc Vũ tiểu thư chính là chính thức luyện đan sư, nàng có thể giúp.” Một bên Vân Đào vội vàng nói."),t("br"),t("br"),n._v("Mọi người đồng loạt đưa mắt tập trung lại đây."),t("br"),t("br"),n._v("“Phải làm sao, ta có thể ra tay.” Mạc Vũ tiểu thư hai tay chắp ở sau lưng, một mặt ngạo nghễ."),t("br"),t("br"),n._v("Mặc dù đối với tên trước mắt này không quá cảm mạo, nhưng chỉ cần có thể cứu Khiếu Thiên thú, làm cho nàng làm chuyện gì cũng có thể."),t("br"),t("br"),n._v("Lại nói, những phương diện khác cũng không sánh nổi đối phương, lần này rốt cục có thể triển lộ luyện đan sư thiên phú mở mày mở mặt, rửa sạch nhục nhã."),t("br"),t("br"),n._v("Ngươi không phải thuần phục thú lợi hại sao? Không phải danh sư học đồ sao? Không phải liền y đạo đều có thể nói ra một, hai ba sao?"),t("br"),t("br"),n._v("Tuy rằng những cái này cũng không sánh nổi ngươi, ta chí ít còn có một cái đan đạo!"),t("br"),t("br"),n._v("Chí ít ta là một vị chính thức nhất tinh luyện đan sư!"),t("br"),t("br"),n._v("Một mặt kiêu ngạo trong đám người đi ra, đang muốn hỏi đối phương làm sao giúp, liền thấy đối diện thanh niên hơi nhướng mày, mang theo nghi vấn ngữ khí hỏi."),t("br"),t("br"),n._v("“Ngươi... Biết luyện đan sao?”"),t("br"),t("br"),n._v("“Ngươi...”"),t("br"),t("br"),n._v("Mạc Vũ tiểu thư một cái lảo đảo, suýt chút nữa không tại chỗ nổ."),t("br"),t("br"),n._v("Ngươi còn có thể hay không nói tiếng người?"),t("br"),t("br"),n._v("Ta là nhất tinh luyện đan sư, đương nhiên biết luyện đan!"),t("br"),t("br"),n._v("Không biết luyện đan làm sao thi đậu?"),t("br"),t("br"),n._v("Sớm biết cái tên này sẽ không nói cái gì êm tai, không nghĩ tới như vậy đáng ghét."),t("br"),t("br"),n._v("Hàm răng cắn khanh khách vang vọng, tức giận hô hấp dồn dập, ngực liên tục chập trùng: “Ngươi gặp qua không biết luyện đan luyện đan sư sao?”"),t("br"),t("br"),n._v("“Thấy qua...” Trương Huyền lắc đầu: “Ta sợ ngươi cũng là Luận đan thành tựu luyện đan sư, như vậy thì sẽ không luyện chế...”"),t("br"),t("br"),n._v("“Luận đan? Vậy cũng là đối với luyện đan tinh thông đến nhất định thực lực đan đạo Đại sư mới có thể làm đến!”"),t("br"),t("br"),n._v("Mạc Vũ tiểu thư trong mắt lộ ra vẻ sùng bái: “Loại này tiền bối, mỗi một cái đều có kinh thiên động địa tài năng, ngươi lại còn nói bọn họ không biết luyện chế đan dược? Đùa gì thế! Nếu như ngươi dám ở luyện đan sư công sẽ như vậy nói, tuyệt đối sẽ bị người tại chỗ đánh chết...”"),t("br"),t("br"),n._v("Nàng lời còn chưa nói hết, liền thấy đối diện thanh niên yên lặng lấy ra một cái luyện đan sư huy chương đeo ở trên người, gãi đầu một cái, một mặt lúng túng."),t("br"),t("br"),n._v("“Ta chính là ngươi nói loại này tiền bối, vừa vặn không biết luyện đan...”"),t("br"),t("br"),n._v("Convert by: ThấtDạ"),t("br"),t("br"),t("br"),t("br")]),n._v(" "),t("hr"),n._v(" "),t("p",[t("a",{attrs:{href:"./chap-265"}},[n._v("Chương trước")]),n._v("  |  "),t("a",{attrs:{href:"./chap-267"}},[n._v("Chương sau")])])])}),[],!1,null,null,null);h.default=i.exports}}]);